;DROP TABLE IF EXISTS `productos`;/*!40101 SET @saved_cs_client     = @@character_set_client */;/*!40101 SET character_set_client = utf8 */;CREATE TABLE `productos` (
CREATE TABLE `productos` (
  `Id_Producto` int(3) NOT NULL AUTO_INCREMENT,
  `Id_Provedor` int(3) DEFAULT NULL,
  `Id_Categoria` int(3) DEFAULT NULL,
  `Foto` blob DEFAULT NULL,
  `Nom_Producto` varchar(20) DEFAULT NULL,
  `Disponibilidad` varchar(10) DEFAULT NULL,
  `cantidad` int(4) DEFAULT NULL,
  `Fecha_ven` date DEFAULT NULL,
  `Precio` float DEFAULT NULL,
  PRIMARY KEY (`Id_Producto`),
  KEY `Id_Provedor` (`Id_Provedor`),
  KEY `Id_Categoria` (`Id_Categoria`),
  CONSTRAINT `productos_ibfk_1` FOREIGN KEY (`Id_Provedor`) REFERENCES `proveedores` (`Id_Provedor`),
  CONSTRAINT `productos_ibfk_2` FOREIGN KEY (`Id_Categoria`) REFERENCES `categoria` (`Id_Categoria`)
